INSERT INTO `catalog_pages` VALUES (464, 402, '2008', '2008 - Sandcastle', 'default_3x3', 1, 274, 1, 1, '1', '1', '0', '0', 'summer', 'catalog_teaser_cch_furni', '', 'Who hasn\'t dreamt of making a sandcastle they fit in? Now you can!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (503, 209, 'jet_set', 'Jet Set', 'default_3x3', 1, 237, 1, 10, '0', '0', '0', '0', 'jetset_header', 'jetset_yachtcomp', '', 'Live life to the fullest with our Jetset furni range. This is the Furni fen those Habbos who like to throw obscenely huge parties and show off their style.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (17, 568, 'mode', 'Mode', 'default_3x3', 1, 39, 1, 16, '1', '1', '0', '0', 'catalog_mode_headline1', 'catalog_mode_teaser1', '', 'Steely functionality combined with a sleek designer upholstery. The Habbo who chooses this furniture is a cool urban cat - streetwise, sassy and so slightly untouchable.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (179, 180, 'aqua_pura', 'Aqua Pura', 'default_3x3_color_grouping', 1, 48, 1, 1, '1', '1', '0', '0', 'puraheader', 'catalog_pura_teaser1', '', 'This collection breathes fresh, clean air and cool tranquility. Use it to create a haven away from the hullabaloo of the public spaces or your life outside the hotel.', '', '', '', 0, '');
