INSERT INTO `catalog_pages` VALUES (281, 568, 'area', 'Area', 'default_3x3', 1, 14, 1, 3, '1', '1', '0', '0', 'catalog_area_headline1', 'catalog_area_teaser1', '', 'A chunky and sofisticated line for the down-to-earth, It\'s simplicty is beautful and will add a welcoming charm to every room.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (282, 209, 'country', 'Country', 'default_3x3', 1, 21, 1, 3, '1', '1', '0', '0', 'country_header1_en_001', 'country_teaser1', '', '\"Moving to the country, gonna eat a lot of peaches\"... The great outdoors is calling with the Country Furni range!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (277, 2, 'pet_animals', 'Pets', 'pets3', 1, 18753, 1, 12, '1', '1', '0', '0', 'catalog_pet_headline1_en', 'ctlg_pet_note', '', 'Pets are inhabitants of Habbo Hotel so each pet owner needs to know a bit about them. If you want to look after your pet properly, make sure you read the following points carefully.', 'A few things you should know:', '*You can place a pet in your room or take one for a walk with you in other rooms.\n*You can\'t trade your pet but they can follow you to friend\'s rooms to gather scratches.\n*You can have up to 50 pets in your room, but look after them all!\n\n\n*Look after your pet with food, water and treats. Check the Pets\' Accessories.\n*Unlock Badges and Achievements by Training your Pet.', 'Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!', 0, '');
INSERT INTO `catalog_pages` VALUES (18, 568, 'lodge', 'Lodge', 'default_3x3', 1, 37, 1, 15, '1', '1', '0', '0', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', '', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (19, 511, 'colourable_plasto', 'Colourable Plasto', 'default_3x3_color_grouping', 1, 46, 1, 1, '1', '1', '0', '0', 'plastic', 'plastic_pasic_promo_1', '', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (182, 604, 'bathroom', 'Bathroom', 'default_3x3', 1, 4552, 1, 3, '1', '1', '0', '0', 'bathroom_catahead', 'bcbath_catateaser', '', 'Give yourself and your guests somewhere to freshen up - vital if you want to avoid nasty smells. Might be an idea to put your loo in a corner though.', '', '', '', 0, '');
