INSERT INTO `catalog_pages` VALUES (362, 387, 'ice_cafe', 'Ice Cafe', 'default_3x3', 1, 264, 1, 14, '1', '1', '0', '0', 'catalog_header_classics', 'classic5_furnis', '', 'The Ice Cafe was used a a meeting place in Habbo Experience for Chaplin and his friends.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (107, 25, '', 'Groups', 'guilds', 1, 36900, 1, 99, '1', '1', '0', '0', 'catalog_groups_en', 'catalog_groupsteaser_en', '', 'Habbo Groups are a great way to stay in touch with your friends and share your interests with others. Each Group has a homeroom that can be decorated by other Group members, members can also purchase exclusive Group Furni that can be customised with your Group colours!', '', '* Get together with people you get together with!\r\n* Co-op room decorating for group members\r\n* Show off your group badge!\r\n* Get some neat Furni in your group\'s colours!', 'What\'s So Great About Habbo Groups?', 0, '');
INSERT INTO `catalog_pages` VALUES (108, 107, 'group_furni', 'Group Furni', 'guild_furni', 1, 28, 1, 1, '1', '1', '0', '0', 'catalog_groups_en', '', 'guild_custom_furni', 'Show off your Group spirit with the new customisable Furni. Select your Group and then get your furni in your Groups colours.', '', '', '', 0, '');
