INSERT INTO `catalog_pages` VALUES (110, 209, 'vikings', 'Vikings', 'default_3x3', 1, 208, 1, 23, '1', '1', '0', '0', 'vikings_catalog_header', 'catalog_teaser_vikings', '', 'From weapon racks and heads on spikes, to ornate hand-carved wooden chairs and benches. This furni has everything you need and more to create the Viking village of your dreams. With furni available in clan colours, you can display your true loyalty with pride!', '', '', '', 0, '');
