INSERT INTO `catalog_pages` VALUES (112, 209, 'wild_wild_west', 'Wild Wild West', 'default_3x3', 1, 229, 1, 24, '1', '1', '0', '0', 'catalog_header_wwest', 'catalog_teaser_wildwest', '', 'From the Shoot\'em Up Saloon to the Sheriff\'s Office, and all the floor tiles, cacti and tumbleweeds in between...Wild West furni has made it\'s way to town.', '', '', '', 0, '');
