INSERT INTO `catalog_pages` VALUES (1560, 15, '', 'Front Page', 'pets3', 1, 18763, 1, 0, '1', '1', '0', '0', '', 'bobba4', '', '', 'Rares & Economy', '<img src= /uploads/cetere.png align=right></a><b>LTD\'s</b><br>LTD Rares are released weekly. Depending on demand and user activity, we tend to release 1-2 LTD\'s at a time for varying costs of varying currencies.<br><br><b>Featured Rares</b> <br>Every month we will feature two classic rare items available for purchase directly from the catalog. These items are also available, at your risk, using our Cases interface.<br><br>myBoBBa prides itself on maintaing a fair and strict economy. These include using tools such as dice rolling logs, trade logs, marketplace logs, pay logs and auto-game logs to monitor new trends and to determine if any abuses occoured within the hotel. Trade data and Marketplace data is accurately analyzed to provide approximate trade values of items, which can be found on the Rare Values popup underneath the level system.', '<img src= /uploads/ducker.png align=left> </a>Your purchases and trade logs are monitored by Hotel Management.', 0, '');
