INSERT INTO `catalog_pages` VALUES (220, 2, '', 'Marketplace', 'pets3', 1, 69, 1, 15, '1', '1', '0', '0', 'catalog_marketplace_header_en', 'catalog_note_marketplace', '', 'Habbo Marketplace is a convenient and safe way to buy and sell items in Habbo.', 'How does the Habbo Marketplace work?', 'Buying items: Browse for the item you want to buy on the Marketplace Offers page and click Buy. We guarantee you\'ll get the item at the cheapest price available at the moment of purchase. No requirements needed.\r\n\r\nSelling items: You can sell any item which is tradable by selecting the item in your inventory and clicking on \'Sell in Marketplace\'. You also can use items currently in the Shop.\r\n\r\nNOTE: you can only sell 250 furni at a time.\r\n\r\nRequirements: To sell your Furni in the Marketplace you\'ll need a Trading Pass, which you can get completing the first steps of the Talent Track.', '', 0, '');
