INSERT INTO `catalog_pages` VALUES (225, 568, '', 'Trophies', 'trophies', 1, 221, 1, 0, '1', '1', '0', '0', 'trophies', '', '', 'Everyone\'s a winner, baby! And now you can reward them all with our fabulous glittering array of bronze, silver and gold trophies.\n\nFirst choose the trophy model by click the arrows. Then select the metal. Type your inscription below and we\'ll engrave it on the trophy along with your name and today\'s date.\nRemember - it\'s permanent!', '', '', '', 0, '');
