INSERT INTO `catalog_pages` VALUES (240, 376, '2013_love_locks', 'Functional Love Locks', 'default_3x3', 1, 62, 1, 2, '1', '1', '0', '0', 'catalog_header_val12', 'val14_lovelock3', '', 'Friendship Padlocks are Furni that show how special your friends are. You and your friend need to be in your room. Put the Padlock in the Room, click 2x on it, and confirm the action. Once closed, your friendship will be saved forever, even if you trade it!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (241, 240, '2014_l0-v3_machines', 'LOVE Machines', 'default_3x3', 1, 62, 1, 12, '1', '1', '0', '0', 'valentines_catalog_header', 'lovelock_s_promo', '', 'Put your love to the test! Lock in your Valentine for life with these Machines.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (454, 376, '2013_gondolas', '2013 - Gondolas', 'default_3x3', 1, 62, 1, 8, '1', '1', '0', '0', 'catalog_header_val12', 'catalog_love_teaser1', '', 'Gondola rides in Venice, it doesn\'t get much more romantic than that!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (242, 234, 'saddles', 'Saddles', 'petcustomization', 1, 135, 1, 4, '1', '1', '0', '0', 'catalog_saddles_header2_en', 'sadddles', '', 'To use a saddle, place it in a room where you have at least one Horse. Double click the saddle and select what horse you want to ride After placing the saddle you can ride your Horse by clicking on it and selecting \'Ride\'.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (453, 376, '2008_habborella', '2008 - Habborella', 'default_3x3', 1, 62, 1, 1, '1', '1', '0', '0', 'catalog_val_headline1_en', 'valentine_furni_001', '', 'Find your true love with the Love Randomiser, and how better to celebrate than with a box of chocolates?', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (243, 234, 'dyes', 'Dyes', 'petcustomization', 1, 133, 1, 5, '1', '1', '0', '0', 'catalog_horsedyes_header2_en', 'dyes', '', 'Customize your horse with this selection of hair colours and body types. Each dye can also be added to your room as a piece of furniture. To use a dye place it to your room, double click on it and then select the horse you want to customise.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (452, 376, '2010_heartbreak_hotel', '2010 - Heartbreak Hotel', 'default_3x3', 1, 62, 1, 4, '1', '1', '0', '0', 'catalog_header_val12_2_en', 'catalog_love_teaser1', '', 'A gift basket and a cuddly teddy for your Valentine, and some cozy seats for your date.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (244, 234, 'hair_styles', 'Hair Styles', 'petcustomization', 1, 134, 1, 6, '1', '1', '0', '0', 'catalog_horsehairstyles2_header_en', 'hairs', '', 'Customize your horse and make him unique with this selection of hair styles.  Each style can also be added to your room as a piece of furniture. To use a hair style place it to your room, double click on it and then select the horse you want to customise.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (450, 376, '2013_masquerade_ball', '2013 - Masquerade Ball', 'default_3x3', 1, 62, 1, 10, '1', '1', '0', '0', 'catalog_header_val12_2_en', 'valentines_catalog_teaser', '', 'With a smell of flowers and love, use this furni to make your perfect erden party.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (245, 209, 'horse_jump', 'Horse Furni', 'default_3x3', 1, 226, 1, 8, '1', '1', '0', '0', 'catalog_header_jumping_en', 'catalog_teaser_horsejump', '', 'Take your horse jumping with these new Furni! Build a formidable race course to test your steed and your riding skills and challenge your friends!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (449, 376, '2017_wedding', 'Plan a Wedding', 'default_3x3', 1, 62, 1, 3, '1', '1', '0', '0', 'catalog_header_val12', 'catalog_love_teaser1', '', 'Do I hear wedding bells? The perfect outdoor setting awaits!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (246, 209, 'monster_plants', 'Monster Plants', 'pets3', 1, 153, 1, 13, '0', '0', '0', '0', 'catalog_header_mopla_01', 'ctlg_monster_note', '', 'Monster Plants can sure be a handful, this page gives you some extra advice on raising and looking after your monsterous brood.', 'Taking Care Of Your Plant', 'Your plants need to be tended regularly, or else they die. To ensure a healthy plant tend it every 30 hours\nor so. If it dies, you can use the Revival potion to\nbring it back to life.\nBreeding\nTo breed your plant you have to wait until it\'s fully\ngrown. Clicking Breed on the menu will show you\nwhat other plants in the room are available to breed\nwith.', '', 0, '');
INSERT INTO `catalog_pages` VALUES (448, 376, '2019_restaurant', '2019 - Restaurant', 'default_3x3', 1, 62, 1, 17, '1', '1', '0', '0', 'catalog_header_val12_2_en', 'val19_newfurni', '', 'Perfect for a romantic evening with your loved one.\n', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (247, 246, 'monster_plant_seeds', 'Monster Plant Seeds', 'default_3x3', 1, 156, 1, 1, '1', '1', '0', '0', 'catalog_header_mnstrSeeds', 'quest_teaser_monsterplants', '', 'Plant your seeds in your room and tend to keep them alive and healthy. After your plants have matured you can breed your plants to try and get leveled up offspring. Plants can only breed once without using the Rebreeding Potion.', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (446, 376, '2012_prom', '2012 - Prom', 'default_3x3', 1, 62, 1, 7, '1', '1', '0', '0', 'valentin2012-1', 'catalog_love_teaser1', '', 'Prom is full of crying teens and bad dance moves, but it\'s always a fond memory for many. Create your perfect prom with this furni!', '', '', '', 0, '');
