INSERT INTO `catalog_pages` VALUES (881, 277, 'monkey', 'Pet Monkey', 'pets', 1, 166, 1, 2, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'This mischevious monkey has made his way into the hotel and into our hearts. From the tilted beret to his love of bunches of bananas- this Monkey is sure to liven up your Habbo life!', '', 'Name your Monkey:', NULL, 0, '');
INSERT INTO `catalog_pages` VALUES (931, 277, 'bunny_manic', 'Bunny - Manic', 'pets', 1, 149, 1, 10, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'One of the most feared creatures in nature, and perhaps the most misunderstood. The majority of Spiders have sharp fangs that inject venom into their prey- but don\'t worry, these spiders won\'t bite ! Maybe...', '', 'Name your pet:', '', 0, '');
INSERT INTO `catalog_pages` VALUES (891, 277, 'horse', 'Pet Horse', 'pets', 1, 132, 1, 1, '1', '1', '0', '0', 'catalog_horse_header2_en', '', '', 'You can ride your horse around the Hotel and customize its body and hair colour.', '', 'Name your Horse:', NULL, 0, '');
INSERT INTO `catalog_pages` VALUES (901, 277, 'bunny', 'Bunny', 'pets', 1, 148, 1, 99, '1', '1', '0', '0', 'babypets_cata_header', '', '', 'OINK! Partial to a good roll in the mud, these playful piggies have trotted into the hotel and are ready for fun!', '', 'Name your Piglet:', 'Select your colour/breed:\n', 0, '');
